import Hero from '../components/Hero';
import Banner from '../components/Banner';
import { Link } from 'react-router-dom';


const home = () => {
    return (
        <Hero>
            <Banner title="luxurious rooms" subtitle="deluxe room
            staring at $299">
                <Link to="/rooms" clasName="btn-primary">
                     our rooms
                </Link>
            </Banner>
        </Hero>
    );
}

export default home;
